import React, { useEffect, useState } from "react";
import "./Pages.css";

const Telephones = () => {
  const [brands, setBrands] = useState([]);
  const [tel, setTel] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch("/db.json");
        const data = await response.json();
        console.log("Data", data);
        setBrands(data.data.brendlertel);
      } catch (error) {
        console.log("error data", error);
      }
    };
    fetchData();
  }, []);

  useEffect(() => {
    const telData = async () => {
      try {
        const res = await fetch("/db.json");
        const item = await res.json();
        console.log("tel data", item);
        setTel(item.telephones);
      } catch (error) {
        console.error("error data", error);
      }
    };
    telData(); // telData funksiyasını burada çağırın
  }, []); // useEffect'in dependency array'ini boş buraxmayın

  return (
    <div className="telephones">
      <div className="left">
        <ul>
          <li>
            <strong>Brendlər</strong>
          </li>
          {brands ? (
            brands.map((brand) => <li key={brand.id}>{brand.name}</li>)
          ) : (
            <li>Yüklənir...</li>
          )}
        </ul>
      </div>

      <div className="telephones">
    <div className="left">
      <ul>
        {brands && brands.length > 0 ? (
          brands.map((brand) => <li key={brand.id}>{brand.name}</li>)
        ) : (
          <li>Yüklənir...</li>
        )}
      </ul>
    </div>

    <div className="right">
      {tel && tel.length > 0 ? (
        tel.map((item) => (
          <ul key={item.brand}>
            <li>
              <strong>{item.brand}</strong>
              <ul>
                {item.models && item.models.length > 0
                  ? item.models.map((model, index) => (
                      <li key={index}>{model}</li>
                    ))
                  : null}
              </ul>
            </li>
          </ul>
        ))
      ) : (
        <li>Yüklənir...</li>
      )}
    </div>
  </div>
    </div>
  );
};

export default Telephones;
